// src/components/SetupPreview/SetupPreview.tsx

import classes from "./SetupPreview.module.css";
import { Fumen } from "../Fumen/Fumen"; // assuming this is your field renderer

interface SetupPreviewProps {
    name: string;
    fumen: string;
    totalCover: number;
    solveRate: number;
}

const SetupPreview = ({ name, fumen, totalCover, solveRate }: SetupPreviewProps) => {
    return (
        <div className={classes.preview}>
            <div className={classes.fumenContainer}>
                <Fumen fumen={fumen} />
            </div>
            <div className={classes.details}>
                <div className={classes.name}>{name}</div>
                <div className={classes.stats}>
                    <span>Cover: {(totalCover * 100).toFixed(1)}%</span>
                    <span>Solves: {(solveRate * 100).toFixed(1)}%</span>
                </div>
            </div>
        </div>
    );
};

export default SetupPreview;
